import React, { Component } from 'react';

export default class DropDown extends Component{
	constructor(props) {
        super(props)       
		this.state = {
			options : [
				{
					id:"1",
					option:"Option 1"
				},
				{
					id:"2",
					option:"Option 2"
				}
			]
		}
    }

	render(){
		var options = this.state.options;
		console.log(options);
		let showOptions;
		if(typeof(options) == "objects" && options != 'undefined'){
			showOptions = Object.keys(options).map((option,index) => {
				return(
					<option value={options[index].options} key={index}>{options[index].options}</option>
				);
			})
		}
		return(
			<div className="container">
				<div className="row">
					<div className="col-sm-4">
					<form>
						<select name="cars" className="custom-select mb-3">
					      	{showOptions}
					    </select>
					</form>
					</div>
				</div>
			</div>
		);
	}
}
